instance.peoplecode_text:
/**
* Gets/Sets Student Placement data into/from a staging table
* @company CCC Tech Center
* @version CAv4.5.0
*/
class CCTC_StudentPlacements
   method CCTC_StudentPlacements();

   method getPlacement(&bindVars As array of any) Returns array of array of any;

   method setPlacement(&bindVars As array of any) Returns array of array of any;

   method removePlacement(&bindVars As array of any) Returns array of array of any;

end-class;

method CCTC_StudentPlacements
   rem do nothing;
end-method;

/**
* This function provides an interface to the College Adaptor to 
* retrieve the MOST RECENT Student Placement data based on sequence number
* from a staging table
* 
* @param &bindVars array of keys to retrieve from the staging table
* &bindVars[1]: MIS Code of college student completed application
* &bindVars[2]: California Community College id of the student
* &bindVars[3]: Statewide Student ID of student completed application; must be included but can be blank
* @Returns first matching row (if any), empty array if not found
*/
method getPlacement
   /+ &bindVars as Array of Any +/
   /+ Returns Array2 of Any +/

   If &bindVars.Len <> 3 Then
      Error "bindVars should have 3 elements when getting placement";
   End-If;

   Local string &cccid = &bindVars [1];
   If None(&cccid) Then
      Error "cccid is required";
   End-If;

   Local string &miscd = &bindVars [2];
   If None(&miscd) Then
      Error "miscd is required";
   End-If;

   Local array of any &AAny = CreateArrayAny();
   Local array of array &result_list = CreateArrayRept(&AAny, 0);

   Local SQL &sql = GetSQL(SQL.CCTC_PLCMT_STG_GET, &bindVars);
   If &sql.Status <> %SQLStatus_OK Then
      Error String(&sql.Status);
   Else
      Local number &i = 0;
      Local number &maxRows = 1;
      While &sql.Fetch(&AAny) And
            &i < &maxRows
         Local number &j = 0;
         Local array of any &temp = CreateArrayAny();
         For &j = 1 To &AAny.Len
            &temp.Push(&AAny [&j]);
         End-For;
         &result_list.Push(&temp);
         &i = &i + 1;
      End-While;
   End-If;
   &sql.Close();

   Return &result_list;

end-method;

/**
* This function provides an interface to the College Adaptor to 
* insert Student Placement data into a staging table
* 
* @param &bindVars array of data to insert into the staging table
* @Returns 2d array with rows affected in first row, first column
*/
method setPlacement
   /+ &bindVars as Array of Any +/
   /+ Returns Array2 of Any +/

   If &bindVars.Len <> 25 Then
      Error "bindVars should have 25 elements when setting placement";
   End-If;

   Local string &cccid = &bindVars [1];
   If None(&cccid) Then
      Error "cccid is required";
   End-If;

   Local number &seqNum = 1;

   Local SQL &seq_sql = GetSQL(SQL.CCTC_PLCMT_SEQ_GET, &bindVars);

   If &seq_sql.Status <> %SQLStatus_OK And
         &seq_sql.Status <> %SQLStatus_NotFound Then
      Error String(&seq_sql.Status);
   End-If;

   If &seq_sql.Status = %SQLStatus_OK Then
      Local array of any &AAny = CreateArrayAny();
      If &seq_sql.Fetch(&AAny) Then
         Local number &j = 0;
         For &j = 1 To &AAny.Len
            &seqNum = &AAny [&j] + 1;
         End-For;
      End-If;
   End-If;
   &seq_sql.Close();

   &bindVars.Push(&seqNum);

   Local SQL &sql = GetSQL(SQL.CCTC_PLCMT_STG_SET, &bindVars);
   If &sql.Status <> %SQLStatus_OK Then
      Error String(&sql.Status);
   End-If;
   Local number &rowsAffected = &sql.RowsAffected;
   &sql.Close();
   Return CreateArray(CreateArrayAny(&rowsAffected));
end-method;

/**
* This function provides an interface to the College Adaptor to 
* remove Student Placement data from a staging table
* 
* @param &bindVars array of keys to remove from the staging table
* &bindVars[1]: California Community College id of the student
* &bindVars[2]: MIS Code of college student completed application
* @Returns 2d array with rows affected in first row, first column
*/
method removePlacement
   /+ &bindVars as Array of Any +/
   /+ Returns Array2 of Any +/

   If &bindVars.Len <> 2 Then
      Error "bindVars should have 2 elements when removing placement";
   End-If;

   Local string &cccid = &bindVars [1];
   If None(&cccid) Then
      Error "cccid is required";
   End-If;

   Local string &miscd = &bindVars [2];
   If None(&miscd) Then
      Error "miscd is required";
   End-If;

   Local SQL &sql = GetSQL(SQL.CCTC_PLCMT_STG_RMV, &bindVars);
   If &sql.Status <> %SQLStatus_OK And
         &sql.Status <> %SQLStatus_NotFound Then
      Error "SQL Status not ok [" | String(&sql.Status) | "]";
   End-If;
   Local number &rowsAffected = &sql.RowsAffected;
   &sql.Close();
   Return CreateArray(CreateArrayAny(&rowsAffected));

end-method;
